     \\/\\/ <p>Make it Mount Pleasant is a handmade and vintage market and afternoon of live entertainment and kids activities. 12:00-6:00 p.m.<\\/p>\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.98407,-37.88877]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>St Kilda beach<\\/strong>'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.97443,-37.86742]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Half Moon Bay<\\/strong>'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [145.01222,-37.96782]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Brighton Beach<\\/strong>'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.98807,-37.91985]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                \\\"<strong>Mothers Beach<\\/strong>\\\"\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [145.03470,-38.21485]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Williamstown Beach<\\/strong>'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.88891,-37.86684]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Sorrento<\\/strong>'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.74101,-38.33893]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                \\\"<strong>Altona Beach<\\/strong>\\\"\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.82937,-37.87060]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Bushrangers Bay Beach <\\/strong'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [145.61982,-38.67225]\\n                        }\\n                    },\\n                    {\\n                        'type': 'Feature',\\n                        'properties': {\\n                            'description':\\n                                '<strong>Hampton Beach<\\/strong'\\n                        },\\n                        'geometry': {\\n                            'type': 'Point',\\n                            'coordinates': [144.99639,-37.93722]\\n                        }\\n                    }\\n                ]\\n            }\\n        });\\n        \\/\\/ Add a layer showing the places.\\n        map.addLayer({\\n            'id': 'places',\\n            'type': 'circle',\\n            'source': 'places',\\n            'paint': {\\n                'circle-color': '#DC143C',\\n                'circle-radius': 6,\\n                'circle-stroke-width': 2,\\n                'circle-stroke-color': '#ffffff'\\n            }\\n        });\\n\\n        \\/\\/ Create a popup, but don't add it to the map yet.\\n        const popup = new mapboxgl.Popup({\\n            closeButton: false,\\n            closeOnClick: false\\n        });\\n\\n        map.on('mouseenter', 'places', (e) => {\\n            \\/\\/ Change the cursor style as a UI indicator.\\n            map.getCanvas().style.cursor = 'pointer';\\n\\n            \\/\\/ Copy coordinates array.\\n            const coordinates = e.features[0].geometry.coordinates.slice();\\n            const description = e.features[0].properties.description;\\n\\n            \\/\\/ Ensure that if the map is zoomed out such that multiple\\n            \\/\\/ copies of the feature are visible, the popup appears\\n            \\/\\/ over the copy being pointed to.\\n            while (Math.abs(e.lngLat.lng - coordinates[0]) > 180) {\\n                coordinates[0] += e.lngLat.lng > coordinates[0] ? 360 : -360;\\n            }\\n\\n            \\/\\/ Populate the popup and set its coordinates\\n            \\/\\/ based on the feature found.\\n            popup.setLngLat(coordinates).setHTML(description).addTo(map);\\n        });\\n\\n        map.on('mouseleave', 'places', () => {\\n            map.getCanvas().style.cursor = '';\\n            popup.remove();\\n        });\\n    });\\n<\\/script>\\n\\n<\\/body>\\n<\\/html>\"},\"elements\":[],\"widgetType\":\"html\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"2b574c6\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\"},\"elements\":[{\"id\":\"9f9f80b\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[],\"isInner\":false},{\"id\":\"f9ce489\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"3be1092\",\"elType\":\"widget\",\"settings\":{\"title\":\" Famous Beaches In Victoria\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false},{\"id\":\"5637bc6\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[],\"isInner\":false}],\"isInner\":false},{\"id\":\"cb4ce39\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\"},\"elements\":[{\"id\":\"d608c5c\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"4ac1bc7\",\"elType\":\"widget\",\"settings\":{\"selected_icon\":{\"value\":{\"url\":\"http:\\/\\/www.oceantp6.ga\\/wp-content\\/uploads\\/2021\\/08\\/beach-1.svg\",\"id\":207},\"library\":\"svg\"},\"view\":\"framed\",\"primary_color\":\"#3DB6E6\",\"_animation\":\"bounceIn\",\"_background_hover_background\":\"gradient\",\"_background_hover_gradient_type\":\"radial\"},\"elements\":[],\"widgetType\":\"icon\"}],\"isInner\":false},{\"id\":\"d7322b9\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"de8e8f6\",\"elType\":\"widget\",\"settings\":{\"icon_list\":[{\"text\":\"St Kilda beach\",\"selected_icon\":{\"value\":{\"url\":\"http:\\/\\/